Verenigde Staten
Animatie

geregisseerd door Lauren Montgomery
met de stemmen van Keri Russell, Nathan Fillion en Alfred Molina

Amazone prinses Diana brengt piloot Steve Trevor terug naar de Verenigde Staten, na zijn crash op het mystieke eiland Themyscria. Diana krijgt dan te maken met de ambities van de Griekse God Ares. Hij wilt een oud voorwerp, de Hand of Rage gebruiken. Met dit voorwerp kan hij de wereld in een eeuwige staat van oorlog veranderen. En hiermee kan hij dan ook wraak nemen op de Amazones van Themyscria. Om haar mensen te redden moet Diana veranderen in Wonder Woman.

